function toggleCollapse(e,o){document.querySelectorAll("."+e).forEach((e,t)=>{let l=document.querySelectorAll("."+o)[t];e.addEventListener("click",()=>{"none"===l.style.display||""===l.style.display?(l.style.display="block",e.textContent="Voir moins -",console.log("textContent block",e.textContent)):(l.style.display="none",e.textContent="Voir plus +",console.log("textContent none",e.textContent))})})}toggleCollapse("collapsible","content_collapse");